        <div className="main">

            <div className="channels">
                <h5 align="center">List of the channels:</h5>
                    <div>
                        <ul>
                            <li>
                            {channel.name}
                            </li>
                        </ul>
                    </div>
            </div>

            <div className="channel">
                <div className="messages">
                    <h1 align="center">Connected in the channel: {channel.name}</h1>
                    <div>

                    </div>
                </div>

            </div>
        </div>
    );
}
export default Main;
